export function Data (key, id, age, gender, race, living, income) {
    return {
      key: key,
      id: id,
      age: age,
      gender: gender,
      race: race,
      living: living,
      income: income
    }
}
var keySample, idSample, ageSample, genderSample, raceSample,
livingSample, incomeSample;
for (let i = 0; i < 100; i++) {
  keySample = [];
  keySample.push(i)
}
//
export const columns = [
  {title: 'ID',dataIndex: 'id', key: 'id',},
  {title: 'Age',dataIndex: 'age', key: 'age',},
  {title: 'Gender',dataIndex: 'gender',key: 'gender',},
  {title: 'Race',dataIndex: 'race',key: 'race',},
  {title: 'Living Situation',dataIndex: 'living',key: 'living',},
  {title: 'Household Income',dataIndex: 'income',key: 'income'}
]

export const data = [];

console.log(keySample);
